        "title": "Medium Size, Welcome To Our Firepit Where Friends and Marshmallows Get Toasted At the Same Time, Hand Stenciled Painted Wood Sign",
        "description": "This sign measures 9 1\/4  x 18 x 3\/4 inches approx. (med size)\r\n\r\nThe sign reads &quot;Welcome to our Firepit where friends and marshmallows get toasted at the same time&quot;.\r\n\r\nThe sign was painted BLACK then I stenciled the letter saying in cream and tan. I also lightly distressed the sign, antiqued and sealed it. I added a saw tooth hanger on the back for easy hanging. If you would like a different color combination or finish (more rustic) please let me know when you make your purchase under the note section to seller. \r\n\r\nAll signs are completely handmade by me from picking out the perfect wood to cutting it, sanding it, to picking out the perfect colors then painting, hand stenciling, distressing, sealing...and then finds it&#39;s way to you to enjoy and treasure for many years to come. Because of the techniques and steps it takes to make each sign they are all unique in there own way and will have variations from the one in picture.\r\n\r\n*Also available in medium size that reads &quot;Bonfire, Campfire and Campsite&quot; \r\n\r\n* Larger sizes available also in each saying.\r\n\r\n*****Please check shop announcement page for current production times as they vary depending on orders. If you need your sign by a specific date please let me at the time of order in the note section to seller.\r\n\r\nAlso please stop back each week to check out the new signs I am busy making for you!\r\n\r\nThank you for looking and happy shopping!",
