        "title": "His and Hers Large Personalized 20oz Hot\/Cold Haworth Mug",
        "description": "What a great mug!  You will find yourself reaching for these mugs for just about everything! Made with tempered glass these mugs are both microwave and freezer friendly. Try filling with ice cream topped with hot fudge, whipped cream and a cherry on top for a pretty and yummy sundae treat! Or a layered parfait or even a cup of hot soup. These are a great housewarming gift for the new couple and will be used for many years to come!. The sturdy and comfortable handle make it a practical gift and the personalized name makes it a memorable gift. \n\nDimensions: Stands 5\u201d \nCapacity: 20 oz\nQuantity: 2\nMicrowave and Dishwasher Safe\nEngraving Included: Name (as shown)\n\nThis glassware is hand crafted using an old world techniques of engraving called stone wheel engraving.\n\n{About the Engraving}\nStone wheel engraving is an age old art form of glass engraving that is not commonly practiced in the world today. With newer technologies such as laser engraving, sandblasting, acid etching and machine engraving, stone wheel engraving has become a dying art. As a stone wheel engraver I spend time shaping my wheel using diamond and stone dressing tools to create different effects on glass. Some I create for a smooth surface, some thick and some thin depending on what lettering and designs I\u2019m engraving. The carbundum wheels that I cut into the glass with are driven with a belt on a lathe that carries a range of interchangeable spindles. I mount each stone wheel onto these spindles prior to dressing them. As I engrave onto the glassware I make cuts into the glass working by hand both upside down and backwards. I sometimes draw guidelines onto the glass however no stencils or templates are used. There will be variations in the lettering, spacing and designs of stone wheel engraving, this is the beauty and character of the art and the one-of-a kind original piece of customized glassware.\n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\nFor CURRENT PRODUCTION TIME please read SHOP ANNOUNCEMENTS on my home page ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\n\n{To Order}\n\u25baStep 1: Add the listing of your choice to your cart\u00a0\n\u25baStep 2: Proceed to checkout via paypal or paypal guest checkout(if you do not have a paypal account)\n\u25baStep 3: Include the following info in the NOTES TO SELLER section at checkout:\u00a0\n\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0\u2022Names\/ Monograms\/ Dates etc for engraving\n\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0\u2022Letterstyle* (if different from sample photos) and\/or any additional engraving details\n\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0\u2022Deadline date if you have one approaching (see shop announcement for my current lead time)\n\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0\u2022Any changes to the &quot;ship to address&quot; (if different from paypal address)\n\u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0\u2022Gift card message (if this is a gift and you would like a hand written card enclosed)\n\u25baStep 4: That&#39;s it! You wil receive an order confirmation email from me within 24 hours of your purchase.\n\nPlease read my policy page before ordering: http:\/\/www.etsy.com\/shop\/glassgirljen\/policy\n\n\n{Info}\n\u25baAny set in my listings can be altered. If you only want one glass...let me know, if you would like ten let me know. I can create a custom listing to suit your needs. Please convo message me and we can customize a listing just for you!\n\u25ba*You can view my wheel cut letterstyle options at www.glassgirljen.blogspot.com (letterstyle tab at the top of the page)\n\u25baAdd this item to your bridal registry! For more information on creating a bridal registry visit http:\/\/www.etsy.com\/help\/article\/2496\n\n\n{News}\n\u25baJoin me on facebook for the latest news, specials and discount offers: http:\/\/facebook.com\/glassengraving\n\u25baVisit our website at: http:\/\/glassengraving.com\n\u25baWatch a video of \u00a0me engraving using the stone wheel engraving process http:\/\/www.youtube.com\/watch?v=9-qE_jcQ8xo\n\u25baGet ideas and see what others have done in my flickr photostream albums: http:\/\/www.flickr.com\/photos\/glassgirljen\u00a0\n\n\n{Some of our latest feedback} http:\/\/www.etsy.com\/people\/glassgirljen\/feedback\n+these glasses were so beautiful! they were the perfect choice for us for our wedding toasting glasses. thank you jennifer for making such an amazing product. would order again!\n-Jen is fantastic! Not only was I amazed at the beauty and craftsmanship of the glassware she created for me, but they arrived without any damage and VERY quickly! Incredible ETSY store!\n+These are so beautiful! They are going to make my wedding extra special, thank you!\nI can&#39;t wait to drink champagne out of my beautiful toasting glass! My fiance was even impressed (and that doesn&#39;t happen often). These glasses will make such a special keepsake for the rest of our life together. Thank you so much Jennifer, you are a truely talented artist!\n\n\n\u2665If you love this item, I welcome you to share your affection! You can add this listing to your etsy favorites, heart my shop, like, tweet or pin it right from this page! Your love and support is very much appreciated \u2665\n\n~every good and perfect gift is from above~\n\nShop more: http:\/\/glassgirljen.etsy.com\n\n\nCategory: Birthday \/ Anniversary\nhttp:\/\/www.etsy.com\/shop\/glassgirljen?section_id=10628530",
