        "title": "DIY Digital Beer Label Invitation Printable",
        "description": "A digital file you can print over and over! This listing is for 5 x 7 invitations.\r\n\r\nThis invitation can be for birthdays or any celebration! \r\n\r\nEach purchase comes with a proof and up to two (2) revisions. Each additional revision is $10.\r\n\r\n\r\nHOW DOES IT WORK?\r\n\r\nSTEP 1:\r\n\r\nPurchase the listing. In the &#39;Note to Seller&#39; section, please provide me with all of the info that you would like on the invitation.\r\n\r\nSTEP 2:\r\n\r\nWithin 2 business days (usually sooner), you will receive a proof of your design to your email address that is listed.\r\n\r\nSTEP 3:\r\n\r\nReview your proof. You have up to two revisions that you can make with the proof process. This proof is a full resolution jpeg that you can use for print if you choose &#39;single jpeg&#39; as your file option.\r\n\r\nSTEP 4:\r\n\r\nApprove your proof. Once approved, I will send you a single 8.5 x 11 pdf with 2 invitations on it. This is an 8.5 x 11 file 300 dpi flattened file. Or\r\n\r\nIf you would prefer the fully printed invitations with 100lb Premium White card stock in the pictures, please let me know and I can reserve a custom listing for you.\r\n\r\nYou will need a few craft supplies for this item:\r\n\r\n-Printer (or have them professionaly printed-easy and inexpensive. Most big box stores allow files to be emailed to them from your home.)\r\n-Cardstock\r\n-Paper Cutter or Scissors\r\n\r\nIf you choose the .pdf file option, you will also need Adobe reader to open this file. Simple and easy to use. Available at: adobe.com.\r\n\r\nThis file is for PERSONAL use only. Whereas, you may print as may times as you need, this file may not be shared or made available on any web site. It is not for commercial use or mass production\/distribution. Contact us if you have any questions!",
